def rc4_crypt(data):
    Physicalinfo = c.Win32_PhysicalMedia()
    key = hashlib.sha1(Physicalinfo[0].SerialNumber).hexdigest()
    S = range(256)
    j = 0
    out = []
    # KSA Phase
    for i in range(256):
        j = (j + S[i] + ord(key[i % len(key)])) % 256
        S[i] , S[j] = S[j] , S[i]
    # PRGA Phase
    i = j = 0
    for char in data:
        i = (i + 1) % 256
        j = (j + S[i]) % 256
        S[i] , S[j] = S[j] , S[i]
        out.append(chr(ord(char) ^ S[(S[i] + S[j]) % 256]))
    return ''.join(out)

def config_save(name, data):    
    tmp = json.dumps(data)
    data = rc4_crypt(tmp)
    hash_v = hashlib.md5(tmp).hexdigest()
    with open(name, 'w') as f:
        f.write(hash_v+data.encode('base64'))

def config_load(name):
    if os.path.exists(name):
        with open(name, 'r') as f:
            data = f.read()
        hash_v = data[0:32]
        data = data[32:]
        data = rc4_crypt(data.decode('base64'))
        if hashlib.md5(data).hexdigest() == hash_v:
            return json.loads(data)
    return False

